// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract AgentTemplate {
    struct Index {
        uint256 version;
        uint256 count;
        string name;
        mapping(string => string) uriToId;
        mapping(string => string) idToUri;
    }

    Index private index;
    bool private indexExists;

    // Function to create a new index catalog
    function createIndex(string memory indexName) external {
        require(!indexExists, "Index already exists");
        index.name = indexName;
        index.version = 1;
        indexExists = true;
    }

    // Function to add a new document CID to the index
    function addDocument(string memory uri, string memory documentCID)
        external
    {
        require(indexExists, "Index does not exist");
        index.count++;
        index.uriToId[uri] = documentCID;
        index.idToUri[documentCID] = uri;
    }

    // Function to retrieve document CID by URI
    function getURIByDocumentCID(string memory cid)
        public
        view
        returns (string memory)
    {
        require(indexExists, "Index does not exist");
        return index.idToUri[cid];
    }

    // Function to retrieve  URI by document CID
    function getDocumentCIDByURI(string memory uri)
        public
        view
        returns (string memory)
    {
        require(indexExists, "Index does not exist");
        return index.uriToId[uri];
    }

    // Function to retrieve the index name, version, and count
    function getIndexInfo()
        public
        view
        returns (
            string memory name,
            uint256 version,
            uint256 count
        )
    {
        require(indexExists, "Index does not exist");
        return (index.name, index.version, index.count);
    }
}

contracts/NFTFactory.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./PayableNFT.sol";
import {Create2} from "@openzeppelin/contracts/utils/Create2.sol";

contract NFTFactory {
    event NFTDeployed(address indexed nftAddress, address indexed owner);

    function deployNFT(
        address owner,
        uint256 _mintPrice,
        bytes32 _nounce
    ) public {
        bytes memory bytecode = abi.encodePacked(
            type(PayableNFT).creationCode,
            abi.encode(_mintPrice, owner)
        );

        // Deploy the contract using Create2
        address newNFTAddress = Create2.deploy(0, _nounce, bytecode);
        emit NFTDeployed(address(newNFTAddress), owner);
    }

    function computeAddress(
        uint256 _mintPrice,
        address owner,
        bytes32 _nounce
    ) public view returns (address) {
        bytes memory bytecode = abi.encodePacked(
            type(PayableNFT).creationCode,
            abi.encode(_mintPrice, owner)
        );

        return Create2.computeAddress(_nounce, keccak256(bytecode));
    }
}

contracts/PayableNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract PayableNFT is ERC721URIStorage, Ownable(msg.sender) {
    uint256 public mintPrice;
    uint256 public tokenCounter;
    address public authorAddress;
    string public cid;

    constructor(uint256 _mintPrice, address _ownerAddress)
        ERC721("ZeroNFT", "ZNFT")
    {
        mintPrice = _mintPrice;
        tokenCounter = 0;
        authorAddress = _ownerAddress;
        transferOwnership(_ownerAddress);
    }

    function mintNFT() public payable {
        require(
            msg.value == mintPrice,
            "Please submit the exact minting price"
        );
        _safeMint(msg.sender, tokenCounter);
        _setTokenURI(tokenCounter, string(abi.encodePacked("ipfs://", cid)));
        tokenCounter++;
    }

    function setMintPrice(uint256 _newMintPrice) public onlyOwner {
        mintPrice = _newMintPrice;
    }

    function setCID(string memory _cid) public onlyOwner {
        cid = _cid;
    }

    function withdraw() public onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}

